import React from 'react';
import ReactDOM from "react-dom";
import NowPlaying from '/pages/NowPlaying'
import './App.css';

function App() {
  return (
    <div className="App">

      <header className="App-header">
      <div id="circle">
        <h1 id="main-heading">The <br></br>Ultimate <br></br>Moviegoers <br></br>Guide</h1>
        </div> 
      </header>


ReactDOM.render(
  <Main/>, 
  <NowPlaying/>
)


    </div>
  );
}

export default App;
